static uint8_t gif_buf[BUFFERSIZE];
uint8_t g_bGIFProcessorBusy = 0;;
uint8_t g_bGIFStartRequest = 0;
uint8_t g_bGIFStopRequest = 0;
uint8_t g_bGIFPlaying = 0;

// Current frame index
uint8_t g_iCurrentFrame = 0;
int8_t g_iDirection = 1;

void PlayGif()
{
	g_bGIFStartRequest = 0;
	g_bGIFPlaying = 1;
	g_iCurrentFrame = 1;
	g_iDirection = 1;
	LCD_Fill(LCD, COLOR_BLACK);
	LCD_SetBackLight(LCD, 100); // turn backlight off
	ShowFrame(1);
	delay_ms(50);
	LCD_SetBackLight(LCD, 0); // turn backlight back on
	while (!g_bGIFStopRequest)
	{
		delay_ms(gif_frame_delays_ms[g_iCurrentFrame]);
		g_iCurrentFrame += g_iDirection;
		ShowFrame(g_iCurrentFrame);
		if (!g_iCurrentFrame)
			g_iDirection = 1;
		else if (g_iCurrentFrame == 16)
			g_iDirection = -1;
	}
	g_bGIFPlaying = 0;
	g_bGIFStopRequest = 0;
}

void ShowFrame(uint8_t frame)
{
	g_bGIFProcessorBusy = 1;
	uint8_t currentSegment = 0;
	const uint8_t* encoded_image = gif_frames[frame];
	uint32_t totalbytes = 0;
	
	for (uint32_t j = 0; j < gif_frame_lens[frame]; j += 3)
	{
		for (uint8_t i = 0; i < encoded_image[j]; i++)
		{
			gif_buf[totalbytes++] = encoded_image[j + 1];
			gif_buf[totalbytes++] = encoded_image[j + 2];
			if (totalbytes == BUFFERSIZE)
			{
				LCD_DrawImage(LCD, 29, 109 + currentSegment * 100 / SEGMENTS_COUNT, 182, 100 / SEGMENTS_COUNT, (uint16_t*)gif_buf, 1);
				currentSegment++;
				delay_ms(CROSS_BUFFER_DELAY_MS);
				totalbytes = 0;
			}
		}
	}

	g_iCurrentFrame = frame;
	g_bGIFProcessorBusy = 0;
}

